// Navbar.js
import React from 'react';
import './Navbar.css'; // Import CSS file for navbar styles
import image1 from './Cpl.png'
import image2 from './hundered.png'
import image3 from './nzc.png'
import image4 from './superSmach.png'

function Navbar() {
  return (
    <nav className="navbar">
 <div>
 <img src={image1}></img></div>
 <div><img src={image2}></img></div>
 <div><img src={image3}></img></div>
 <div><img src={image4}></img></div>


    </nav>
  );
}

export default Navbar;
